import React from 'react';
import { HashRouter, Route, Routes, Navigate } from 'react-router-dom';

import Dashboard from './dashboard/main_dashboard';
import User from './user/main_user';
import Customer from './customer/main_customer';
import Room from './room/main_room';
import Indexmain from './indexmain';
import Loginmain from './login/main_login';

// import Education from './education';


function App() {
  return (
    <HashRouter>
      <Routes>
        <Route path="/" element={<Navigate to="/main_login" />} />
        <Route path="/main_login" element={<Loginmain />} />
        <PrivateRoute path="/main_dashboard" element={<Dashboard />} isAuthenticated={isAuthenticated} />
        <PrivateRoute path="/main_customer" element={<Customer />} isAuthenticated={isAuthenticated} />
        <PrivateRoute path="/main_user" element={<User />} isAuthenticated={isAuthenticated} />
        <PrivateRoute path="/main_room" element={<Room />} isAuthenticated={isAuthenticated} />
        <PrivateRoute path="/indexmain" element={<Indexmain />} isAuthenticated={isAuthenticated} />
      </Routes>
    </HashRouter>
  );
}

export default App;
